import React, { Component } from 'react';
import PROJECTS from './data/projects';

class Projects extends Component{
    render(){
        return(
            <div>
                <h1>highlighted Projects</h1>
                <div>
                    {
                        PROJECTS.map(PROJECT => {
                            return (
                                <div>{PROJECT.title}</div>
                            );
                        })
                    }
                </div>
            </div>
        )
    }
}
export default Projects;
